export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:b,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:b,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:b,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:d,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:d,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:10}}},"93ZHvT1MWT":{data:{id:1025,attributes:{imdbId:"tt0116260",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDM4Mzc5ZjAtM2JjMi00NzU1LWEzM2MtNDQzNWI5MmRkM2I1XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"}],item_lang:{data:{id:1688,attributes:{title:g,plot:"Karen McCann's eldest daughter is raped and murdered whilst on the phone with her. When the case against Robert Doob, the perpetrator, is dismissed because of a technicality, she starts following him and sees how he checks out his next victim, a woman he delivers groceries to. She tells the police, but is only warned she must stop following Doob. When she tries to warn the woman, she is shooed out of the house. Doob, having found out that Karen is following him, threatens to do something to her youngest daughter. She then seeks help from a group of vigilantes connected to a support group, in order to shoot Doob. However, a friend from the support group turns out to be an FBI agent investigating the very vigilante activity Karen is involved in and warns her that she will go to jail for the rest of her life unless it is self-defense. In the meantime, tension grows between Karen and her husband Mack, because he finds out she has secretly been taking self-defense classes and has been learning how to use a gun. When Doob makes another victim and is again released for lack of evidence, she finds a way to lure him into her house and kill him in self-defense.",slug:"eye-for-an-eye"}}},books:{data:[{id:5947,attributes:{title:g,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=q4QGkToFAnYC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"1996-12-12",publisher:"Smithmark Publishers",subtitle:a}},{id:5948,attributes:{title:"Freedom Bridge",description:"\"Brilliant! A plot with more twists than barbed wire. Vivid characters. Life-and-death stakes. A provocative political theme. Erika Holzer delivers everything that a thriller fan could possibly want in this revised edition of her novel Double Crossing.\"-----Robert Bidinotto, best-selling author of \"Hunter.\" [Double Crossing reviews are at \"Editorial Reviews.\"] * * * Caught in a web of dangerous intrigue, Dr. Kiril Andreyev plans his desperate escape from Soviet tyranny to freedom in the West. But when his friend's escape attempt ends in flames, Kiril finds his life threatened by a ruthless KGB officer. Kiril's last chance rests on a visiting American heart surgeon and his journalist wife. But even as Kiril plots his escape, he finds that his life depends on his materialistic mistress, on the rivalries of Soviet and East German intelligence agents, and on accidental betrayals by those he trusts most. The story builds to a climax in a deadly confrontation on Glienicker Bridge, linking East Germany and West Berlin. Will Dr. Kiril Andreyev succeed in his lifelong quest for freedom--and at what cost?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=al5rnAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2013-04-01",publisher:a,subtitle:"A Cold War Thriller"}},{id:5949,attributes:{title:"EYE for an EYE: a Novel of Unintended Consequences",description:"This action-packed contemporary urban suspense novel dramatizes how, in seeking revenge for violent crime, decent people can become vigilantes and unleash fatally unintended consequences--as heroine Karen Newman soon learns.",thumbnail:a,authors:[c],firstBook:e,published:"2014-01-10",publisher:a,subtitle:a}},{id:5950,attributes:{title:"The Paladin Curse",description:"FROM THE BESTSELLING AUTHORS OF EYE FOR AN EYE AND FAKE WARRIORSA compelling courtroom procedural-and a provocative morality play.Two former college roommates-now enemies, locked in the fight of their lives: Mike Quade is an unprincipled, politically ambitious prosecutor, driven by a secret hatred and a burning desire for revenge.Jon Willard is an uncompromising defense attorney, trying desperately to survive in a corrupt, cynical profession.When Quade frames an innocent man for murder, the defendant persuades Jon Willard to defend him. Now these two estranged friends will face off in a perilous courtroom battle. The stakes: justice-and their own souls.And the verdict will be decided by...THE PALADIN CURSE.And don't miss Erika Holzer's previous bestselling novels: her acclaimed vigilante crime thriller Eye for an Eye, and her gripping spy novel Freedom Bridge -- both available on Amazon!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=19vezQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Henry Holzer",c],firstBook:e,published:"2020-09-18",publisher:a,subtitle:"A Jon Willard Novel"}},{id:5951,attributes:{title:"Eye for an eye - Auge um Auge",description:a,thumbnail:a,authors:[c],firstBook:e,published:"1996-01-01",publisher:a,subtitle:"der Roman zum Film mit Sally Field, Kiefer Sutherland, Ed Harris"}}]}}},meta:{}}},prerenderedAt:1694069524802}}("","movie","Erika Holzer","series",null,1,"Eye for an Eye"))